webpackJsonp([73571006493156],{1052:function(e,t){e.exports={data:{markdownRemark:{html:'<!--\n* Concept: Componentization - breaking down the app into components promotes separation of concerns and improves maintainability.\n* Concept: Properties\n  * propTypes, defaultProps\n* Component: computed\n* Concept: Arrow Functions\n* Concept: Children\n-->\n<p>In the <a href="../app-setup/">first step</a>, we introduced our sample app and set up the scaffolding. Next, let’s start to break down the app into discrete components and learn how to define and configure a component using <code class="language-text">propTypes</code>, <code class="language-text">defaultProps</code>, and <code class="language-text">computed</code> properties.</p>\n<h2 id="componentization"><a href="#componentization" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Componentization</h2>\n<p>As your application grows, it will become difficult to maintain if all the code lives in <code class="language-text">App.js</code>. Enter components! We’ve already created our App component using the <code class="language-text">kind()</code> factory. Now let’s create a Kitten component to encapsulate the view and behavior of each photo in our browser.</p>\n<blockquote>\n<p>Although it isn’t required to put components into their own modules, it’s a good practice that often improves maintainability and enforces separation of concerns between components.</p>\n</blockquote>\n<h3 id="creating-a-kitten-component"><a href="#creating-a-kitten-component" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Creating a Kitten Component</h3>\n<p>Create <code class="language-text">./src/components/Kitten/Kitten.js</code> and add the following contents:</p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">import kind from &#39;@enact/core/kind&#39;;\nimport PropTypes from &#39;prop-types&#39;;\nimport React from &#39;react&#39;;\n\nconst KittenBase = kind({\n\tname: &#39;Kitten&#39;,\n\n\tpropTypes: {\n\t\tchildren: PropTypes.string,\n\t\tsize: PropTypes.number\n\t},\n\n\tdefaultProps: {\n\t\tsize: 300\n\t},\n\n\tcomputed: {\n\t\turl: (props) =&gt; {\n\t\t\treturn &quot;//loremflickr.com/&quot; + props.size + &quot;/&quot; + props.size + &quot;/kitten&quot;;\n\t\t}\n\t},\n\n\trender: (props) =&gt; (\n\t\t&lt;div&gt;\n\t\t\t&lt;img src={props.url} /&gt;\n\t\t\t&lt;div&gt;{props.children}&lt;/div&gt;\n\t\t&lt;/div&gt;\n\t)\n});\n\nexport default KittenBase;\nexport {KittenBase as Kitten};</code></pre>\n      </div>\n<p>You’ll also need a <code class="language-text">package.json</code> in the same directory to indicate the module’s entry point.</p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">{\n    &quot;main&quot;: &quot;Kitten.js&quot;\n}</code></pre>\n      </div>\n<h2 id="arrow-functions"><a href="#arrow-functions" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Arrow Functions</h2>\n<p>Let’s take this opportunity to introduce a new ES6 feature: <a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Functions/Arrow_functions">arrow functions</a> (<a href="http://www.ecma-international.org/ecma-262/6.0/#sec-arrow-function-definitions">spec</a>). Arrow functions are a more terse way to define functions in JavaScript that lexically bind the <code class="language-text">this</code> value.</p>\n<blockquote>\n<p>In practice, ‘lexical binding’ means that within an arrow function, <code class="language-text">this</code> will point to the same <code class="language-text">this</code> as the context in which the arrow function was defined. More info is available on <a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Functions/Arrow_functions#Lexical_this">MDN</a> or <a href="http://exploringjs.com/es6/ch_arrow-functions.html#_ecmascript-6-solution-arrow-functions">ExploringJS</a>.</p>\n</blockquote>\n<p>Arrow functions can also omit the braces if followed by a single JavaScript expression. With this syntax, the result of evaluating the expression will be returned from the function. To illustrate, the following examples are functionally equivalent (ignoring the scoping of <code class="language-text">this</code>).</p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">// Named Function expression\nfunction sum (a, b) {\n\treturn a + b;\n}\n\n// Unnamed function expression\nconst sum = function (a, b) {\n\treturn a + b;\n}\n\n// &quot;Basic&quot; arrow function\nconst sum = (a, b) =&gt; {\n\treturn a + b;\n}\n\n// &quot;Advanced&quot; arrow function\nconst sum = (a, b) =&gt; (a + b);</code></pre>\n      </div>\n<blockquote>\n<p>When using Advanced arrow functions with JSX, we recommend wrapping the JSX with parenthesis. They aren’t required but the result is more readable and consistent with traditional functions or basic arrow functions that must use parenthesis for multi-line JSX.</p>\n</blockquote>\n<blockquote>\n<p>More on <a href="http://lucumr.pocoo.org/2011/2/6/automatic-semicolon-insertion/">how <code class="language-text">return</code> behaves with new lines</a> and <a href="https://goo.gl/7kI5oT">examples with JSX</a> and the transpiled result.</p>\n</blockquote>\n<p>You may notice that we used both methods of returning data from an arrow function in our <code class="language-text">Kitten</code> component (in the <code class="language-text">computed</code> property and the <code class="language-text">render</code> method).</p>\n<h2 id="properties"><a href="#properties" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Properties</h2>\n<h3 id="code-classlanguage-textproptypescode-property"><a href="#code-classlanguage-textproptypescode-property" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><code class="language-text">propTypes</code> Property</h3>\n<p>The <code class="language-text">propTypes</code> property is a design-time tool to help consumers of a component provide the right kind of data to a component. By specifying <code class="language-text">propTypes</code>, React will warn in the console in development mode if a property does not pass validation. React provides a number of built-in <a href="https://facebook.github.io/react/docs/reusable-components.html#prop-validation">validators</a>.</p>\n<p>By defining properties for every component, even if you’re the only user of it, you have to make intentional decisions about the interface, think through the data the component needs and understand how it will be used.</p>\n<p>In our example, we’ve defined two properties: <code class="language-text">children</code>, a string, and <code class="language-text">size</code>, a number.</p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">propTypes: {\n\tchildren: PropTypes.string,\n\tsize: PropTypes.number\n},</code></pre>\n      </div>\n<blockquote>\n<p>If we wanted to indicate a property is required, we’d append <code class="language-text">.isRequired</code> to the validator — <code class="language-text">children: PropTypes.string.isRequired</code>. All of React’s validators provide the <code class="language-text">.isRequired</code> version of the validator out of the box.</p>\n</blockquote>\n<h3 id="code-classlanguage-textdefaultpropscode-property"><a href="#code-classlanguage-textdefaultpropscode-property" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><code class="language-text">defaultProps</code> Property</h3>\n<p>If you wish to make a property optional with a default value, you can define those defaults within the <code class="language-text">defaultProps</code> object. You do not need to define a default value for every property. In particular, if a property is a string to be displayed or a boolean that is false by default, it is unnecessary to provide a default.</p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">defaultProps: {\n\tsize: 300\n},</code></pre>\n      </div>\n<h3 id="code-classlanguage-textcomputedcode-property"><a href="#code-classlanguage-textcomputedcode-property" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><code class="language-text">computed</code> Property</h3>\n<p>Computed properties for stateless components are a feature unique to Enact and, specifically, the <code class="language-text">kind()</code> factory. The purpose of computed properties is to extract logic that would otherwise live inside the render method in order to keep the render method purely responsible for merging props and markup.</p>\n<p>A computed property is defined within the <code class="language-text">computed</code> object passed to <code class="language-text">kind()</code> and consists of name and a function. The function will receive the props provided to the component with the <code class="language-text">defaultProps</code> applied. It <strong>will not</strong>, however, receive the value of other computed props as all computed props are evaluated from the source props and then the results are merged together before passing on to <code class="language-text">render()</code>.</p>\n<p>To externalize the URL generation, we’ve added a computed prop that takes <code class="language-text">size</code> and builds the URL to <a href="http://loremflickr.com">loremflickr</a>.</p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">computed: {\n\turl: (props) =&gt; {\n\t\treturn &quot;//loremflickr.com/&quot; + props.size + &quot;/&quot; + props.size + &quot;/kitten&quot;;\n\t}\n},</code></pre>\n      </div>\n<h3 id="updating-code-classlanguage-textappjscode"><a href="#updating-code-classlanguage-textappjscode" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Updating <code class="language-text">App.js</code></h3>\n<p>Back in the App component (<code class="language-text">./src/App/App.js</code>), let’s import our new component and place an instance of it in place of the markup we refactored out. We’re omitting <code class="language-text">size</code> to illustrate using the default value. You might also notice that we haven’t included <code class="language-text">children</code> explicitly and instead given <code class="language-text">&lt;Kitten&gt;</code> text content. This is possible in JSX because <code class="language-text">children</code> is treated uniquely to allow React components in JSX to be authored more like markup.</p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">import kind from &#39;@enact/core/kind&#39;;\nimport MoonstoneDecorator from &#39;@enact/moonstone/MoonstoneDecorator&#39;;\nimport React from &#39;react&#39;;\n\nimport Kitten from &#39;../components/Kitten&#39;;\n\nconst AppBase = kind({\n\tname: &#39;App&#39;,\n\n\trender: (props) =&gt; (\n\t\t&lt;div className={props.className}&gt;\n\t\t\t&lt;Kitten&gt;\n\t\t\t\tGarfield\n\t\t\t&lt;/Kitten&gt;\n\t\t&lt;/div&gt;\n\t)\n});\n\nconst App = MoonstoneDecorator(AppBase);\n\nexport default App;\nexport {App, AppBase};</code></pre>\n      </div>\n<h2 id="children-in-react"><a href="#children-in-react" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Children in React</h2>\n<p>When you use JSX, the contents of an element will be evaluated and set as the <code class="language-text">children</code> of that element. Each child can be any renderable type, which includes strings, numbers, and React elements. Other primitives must be converted to one of these types to be included as a child.</p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">&lt;MyComponent&gt;\n\tSome Text Content\n\t{1}\n\t{JSON.stringify({b: 2})}\n\t&lt;AnotherComponent /&gt;\n&lt;/MyComponent&gt;</code></pre>\n      </div>\n<p><code class="language-text">children</code> is, however, just a prop and can be set directly via a JSX attribute, though that is not recommended.</p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">&lt;div&gt;\n\t{/* Don&#39;t do this! */}\n\t&lt;MyComponent children=&quot;Some Text Content&quot; /&gt;\n\t{/* Use this instead */}\n\t&lt;MyComponent&gt;Some Text Content&lt;/MyComponent&gt;\n&lt;/div&gt;</code></pre>\n      </div>\n<blockquote>\n<p>Typically, the <code class="language-text">children</code> prop received by a component will be an array of elements. However, if a single element is passed, <code class="language-text">children</code> will not be an array. <code class="language-text">children</code> should be considered an opaque data structure. To inspect or iterate over it, you should use the <a href="https://facebook.github.io/react/docs/top-level-api.html#react.children">Children</a> utilities provided by React.</p>\n</blockquote>\n<h2 id="conclusion"><a href="#conclusion" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Conclusion</h2>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/KittenBrowser-Step2-697547b96076555e16d9c86d959d823a-4323b.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 325px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 113.53846153846155%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Kitten Browser Step 2"\n        title=""\n        src="/static/KittenBrowser-Step2-697547b96076555e16d9c86d959d823a-4323b.png"\n        srcset="/static/KittenBrowser-Step2-697547b96076555e16d9c86d959d823a-ac1b5.png 173w,\n/static/KittenBrowser-Step2-697547b96076555e16d9c86d959d823a-4323b.png 325w"\n        sizes="(max-width: 325px) 100vw, 325px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>In this step we’ve encapsulated the logic for a single Kitten photo in a new component and explored how to configure that component. In the next section, we’ll show how to create a grid of photos, add some formatting to our component, and introduce a couple more ES6 features.</p>\n<p><strong>Next step: <a href="../lists/">Kitten Browser: Step 3</a></strong></p>',frontmatter:{title:"Reusable Components",github:"https://github.com/enactjs/docs/blob/develop/src/pages/docs/tutorials/tutorial-kitten-browser/reusable-components/index.md"}},allMarkdownRemark:{edges:[{node:{fields:{slug:"/docs/tutorials/tutorial-kitten-browser/app-setup/"},frontmatter:{title:"App Setup"}}},{node:{fields:{slug:"/docs/tutorials/tutorial-kitten-browser/reusable-components/"},frontmatter:{title:"Reusable Components"}}},{node:{fields:{slug:"/docs/tutorials/tutorial-kitten-browser/lists/"},frontmatter:{title:"Repeaters and Lists"}}},{node:{fields:{slug:"/docs/tutorials/tutorial-kitten-browser/"},frontmatter:{title:"Kitten Browser"}}},{node:{fields:{slug:"/docs/tutorials/tutorial-kitten-browser/panels/"},frontmatter:{title:"Organizing Your App with Panels"}}},{node:{fields:{slug:"/docs/tutorials/tutorial-kitten-browser/data-and-state/"},frontmatter:{title:"State and Data Management"}}}]},site:{siteMetadata:{title:"I18N & L10N"}},docsPages:{edges:[{node:{path:"/docs/modules/",context:{title:null}}},{node:{path:"/docs/tutorials/",context:{title:null}}}]},jsMetadata:{edges:[{node:{fields:{slug:"/docs/tutorials/"},fileAbsolutePath:"/home/goun/Source/opensource_iLib/docs/src/pages/docs/tutorials/index.js",frontmatter:{title:"Internationalization"}}},{node:{fields:{slug:"/docs/modules/"},fileAbsolutePath:"/home/goun/Source/opensource_iLib/docs/src/pages/docs/modules/index.js",frontmatter:{title:"Getting Started"}}}]}},pathContext:{slug:"/docs/tutorials/tutorial-kitten-browser/reusable-components/",title:"Reusable Components",parentRegex:"/\\/docs\\/tutorials\\/tutorial-kitten-browser(\\/[^/]*)?\\/$/"}}}});